// src/components/pages/Workouts.tsx
import React from 'react';
import './Workouts.css';
import Header from '../shared/Header/Header';
import Footer from '../shared/Footer/Footer';

interface Workout {
    number: number;
    exercise: string;
    weight: string;
    loadColor: string;
}

const Workouts: React.FC = () => {
    // –ú–æ–∫–æ–≤—ã–µ –¥–∞–Ω–Ω—ã–µ –¥–ª—è —Ç—Ä–µ–Ω–∏—Ä–æ–≤–∫–∏
    const currentWorkout: Workout[] = [
        {
            number: 1,
            exercise: "–ü—Ä–∏—Å–µ–¥–∞–Ω–∏—è –≤ —Ç—Ä–µ–Ω–∞–∂–µ—Ä–µ –ì–∞–∫–∫ - 3 –ø–æ–¥—Ö–æ–¥–∞ –ø–æ 8 –ø–æ–≤—Ç–æ—Ä–µ–Ω–∏–π",
            weight: "60kg",
            loadColor: "#FFD700" // –ñ–µ–ª—Ç—ã–π
        },
        {
            number: 2,
            exercise: "–°—É–ø–µ—Ä—Å–µ—Ç - 3 –ø–æ–¥—Ö–æ–¥–∞\n|--–†–∞–∑–≥–∏–±–∞–Ω–∏—è –Ω–æ–≥ –≤ —Ç—Ä–µ–Ω–∞–∂–µ—Ä–µ - 12 –ø–æ–≤—Ç–æ—Ä–µ–Ω–∏–π\n|-- –°–≥–∏–±–∞–Ω–∏—è –Ω–æ–≥ –≤ —Ç—Ä–µ–Ω–∞–∂–µ—Ä–µ -12 –ø–æ–≤—Ç–æ—Ä–µ–Ω–∏–π",
            weight: "35kg / 40kg",
            loadColor: "#FF4500" // –ö—Ä–∞—Å–Ω—ã–π
        },
        {
            number: 3,
            exercise: "–ü–æ–¥—ä–µ–º –Ω–æ—Å–∫–æ–≤ –Ω–∞ –∏–∫—Ä—ã - 4 –ø–æ–¥—Ö–æ–¥–∞",
            weight: "35kg",
            loadColor: "#32CD32" // –ó–µ–ª–µ–Ω—ã–π
        }
    ];

    // –î–∞–Ω–Ω—ã–µ –¥–ª—è –∫–∞–ª–µ–Ω–¥–∞—Ä—è
    const today = new Date();
    const day = today.getDate();
    const month = today.toLocaleString('default', { month: 'long' });
    const dayName = today.toLocaleString('default', { weekday: 'long' });

    return (
        <div className="workouts-page">
            <Header />
            <main className="workouts-main">
                <div className="workouts-container">
                    {/* –û—Å–Ω–æ–≤–Ω–∞—è —Å–µ—Ç–∫–∞ */}
                    <div className="workouts-content">
                        {/* –õ–µ–≤–∞—è –∫–æ–ª–æ–Ω–∫–∞: –ü–ª–∞–Ω —Ç—Ä–µ–Ω–∏—Ä–æ–≤–∫–∏ */}
                        <div className="plan-card">
                            <h2 className="plan-title">Your Plan!</h2>
                            <div className="plan-tabs">
                                <button className="plan-tab">Upper body push</button>
                                <button className="plan-tab">Upper body pull</button>
                                <button className="plan-tab">Core & stability</button>
                                <button className="plan-tab active">Lower body</button>
                            </div>
                            <div className="plan-table">
                                <div className="table-header">
                                    <div className="header-cell">Number</div>
                                    <div className="header-cell">Exercises</div>
                                    <div className="header-cell">Your work weight</div>
                                    <div className="header-cell">Load</div>
                                </div>
                                {currentWorkout.map((item, index) => (
                                    <div key={index} className="table-row">
                                        <div className="cell">{item.number}:</div>
                                        <div className="cell">{item.exercise}</div>
                                        <div className="cell">
                                            <div className="weight-badge">{item.weight}</div>
                                        </div>
                                        <div className="cell">
                                            <div className="load-dot" style={{ backgroundColor: item.loadColor }}></div>
                                        </div>
                                    </div>
                                ))}
                            </div>
                            <div className="plan-actions">
                                <button className="action-button end-workout">‚úì End workout</button>
                                <button className="action-button generate-new">üîÑ Generate new</button>
                                <button className="action-button add-workout">+ Add your workout</button>
                            </div>
                        </div>

                        {/* –ü—Ä–∞–≤–∞—è –∫–æ–ª–æ–Ω–∫–∞: Actions + Calendar */}
                        <div className="right-column">
                            {/* Actions Card */}
                            <div className="actions-card">
                                <h3 className="actions-title">Actions</h3>
                                <div className="actions-buttons">
                                    <button className="action-button open-statistic">üìä Open statistic</button>
                                    <button className="action-button change-goal">üéØ Change goal</button>
                                </div>
                                <div className="bot-status">
                                    <div className="status-dot"></div>
                                    <span>Bot status</span>
                                </div>
                            </div>

                            {/* Calendar Card */}
                            <div className="calendar-card">
                                <h3 className="calendar-title">Your Calendar</h3>
                                <div className="calendar-wrapper">
                                    <div className="calendar-navigation">
                                        <button className="nav-button">&lt;</button>
                                        <div className="calendar-date-display">
                                            <div className="date-day">{dayName}</div>
                                            <div className="date-number">{day}</div>
                                            <div className="date-month">{month}</div>
                                        </div>
                                        <button className="nav-button">&gt;</button>
                                    </div>
                                    <div className="calendar-message">
                                        Tomorrow you have rest!
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </main>
            <Footer />
        </div>
    );
};

export default Workouts;
